(function() {
    // sticke sidebar
    const stickySidebar = new StickySidebar('.main__sidebar', {
        topSpacing: 0,
        bottomSpacing: 0,
        resizeSensor: true,
        minWidth: 992,
        containerSelector: '.main',
        innerWrapperSelector: '.main__sidebar-inner'
    });
    
    const stickyBlock = document.querySelector('.js-sticky-block');
    if (stickyBlock) {
        new StickySidebar(stickyBlock, {
            topSpacing: 32,
            bottomSpacing: 32,
            resizeSensor: true,
            minWidth: 992
        });
    }
    $('.js-search-toggle').on('click', function(e) {
        e.preventDefault();
        
        $('.icon', this).toggleClass('icon--md-x');
    
        let parent = $(this).parent();
        $('#navbar .navbar__item')
            .not(parent)
            .toggleClass('u-show-md');
    
        $('.top-search', parent).toggleClass('u-show-md');
    });
    $('.js-offcanvas-toggle').on('click', function(e) {
        e.preventDefault();
        e.stopImmediatePropagation();
    
        $(this).find('.icon').toggleClass('icon--md-x');
        $('body').toggleClass('is-offcanvas-opened has-overlay overflow-hidden');
    });
    
    $('.offcanvas').on('click', function(e) {
        if (!$('body').is('.has-overlay') || $(e.target).closest('[class*="offcanvas__"').length) {
            return;
        }
    
        $('.js-offcanvas-toggle .icon').removeClass('icon--md-x');
        $('.offcanvas__panel.is-opened').removeClass('is-opened');
        $('body').removeClass('is-offcanvas-opened has-overlay overflow-hidden');
    });
    
    
    $('.js-panel-toggle[data-panel]').on('click', function(e) {
        e.preventDefault();
        e.stopImmediatePropagation();
    
        $('.offcanvas__panel[data-panel="'+this.getAttribute('data-panel')+'"]').toggleClass('is-opened');
        $('body').toggleClass('has-overlay overflow-hidden');
    });
    $('.sidebar-nav__dropdown.is-active > a').on('click', function(e) {
        e.preventDefault();
        
        let parent = $(this).parent();
        parent.toggleClass('is-active');
    
        $('.sidebar-nav__dropdown').filter((index, element) => {
            return element !== parent[0];
        }).removeClass('is-active');
    
        setTimeout(() => stickySidebar.updateSticky(), 200);
    });
    $('.tabs-nav[data-target] .tabs-nav__item > *').on('click', function(e) {
        e.preventDefault();
        e.stopImmediatePropagation();
        
        let nav = $(this).closest('.tabs-nav');
        let target = nav.attr('data-target');
        let index =  1 + $(this).parent().index();
        let content = $('.tab-content:is('+target+')');
        
        if (!content.length || !content.find('.tab-content__pane:nth-child('+index+')').length) {
            return;
        }
    
        nav
            .find('.tabs-nav__item')
                .removeClass('tabs-nav__item--active')
                .filter(':nth-child('+index+')')
                    .addClass('tabs-nav__item--active');
    
        content
            .find('.tab-content__pane')
                .removeClass('tab-content__pane--active')
                .filter(':nth-child('+index+')')
                    .addClass('tab-content__pane--active');
    });
    
    $(document).on('click', '.control--password', function (e) {
        e.preventDefault();
    
        if (this !== e.target) {
            return;
        }
    
        let input = $(this).find('input');
    
        if (input.is('[type="password"]')) {
            input.attr('type', 'text');
            $(this).addClass('control--password-revealed');
        } else {
            input.attr('type', 'password');
            $(this).removeClass('control--password-revealed');
        }
    });
    
    $(document).on('click', '.control--cleanable', function (e) {
        e.preventDefault();
    
        if (this !== e.target) {
            return;
        }
    
        $(this).find('input').val('');
    });
    $('.js-modal-toggle').on('click', function (e) {
        e.preventDefault();
    
        let modal = false;
    
        if ($(this).is('[data-target]')) {
            modal = $('#'+$(this).data('target'));
        } else if ($(this).is('[href^="#"]')) {
            modal = $($(this).attr('href'));
        }
    
        if (modal) {
            modal.toggleClass('modal--active');
            $('html').toggleClass('u-clipped');
        }  
    });
    $('.js-pgo-open').on('click', function(e) {
        e.preventDefault();
    
        let pageOverlay = false;
    
        if ($(this).is('a[href]')) {
            pageOverlay = $(this.href);
        } else if ($(this).is('[data-target]')) {
            pageOverlay = $('#'+$(this).data('target'));
        }
    
        if (!pageOverlay) {
            return false;
        }
    
        pageOverlay.addClass('page-overlay--active');
        $('body').addClass('overflow-hidden');
    });
    
    $('.js-pgo-close').on('click', function(e) {
        e.preventDefault();
    
        $(this).closest('.page-overlay').removeClass('page-overlay--active');
        $('body').removeClass('overflow-hidden');
    });
    
    $('.js-auth[data-step]').on('click', function(e) {
        e.preventDefault();
        e.stopImmediatePropagation();
    
        let step = $(this).data('step');
        $(document).trigger('orgzdrav-auth', step);
    });
    $('.js-class-toggle[data-targer] .btn[data-class]').on('click', function (e) {
        e.preventDefault();
    
        let parent = $(this).parent();
        let target = $(parent.attr('data-targer'));
        if (!target) return;
    
        parent.find('.btn[data-class]')
            .each((index, element) => { target.removeClass($(element).attr('data-class')); })
            .removeClass('btn--active');
    
        $(this).addClass('btn--active');
        target.addClass($(this).attr('data-class'));
    });
    $('.post table')
        .filter((index, element) => !$(element).closest('.table-container').length)
        .each((index, element) => {
            $(element).wrap('<div class="table-container scrollable" />');
    
            new ScrollBooster({
                viewport: $(element).parent()[0],
                content:  element,
                direction: 'horizontal',
                scrollMode: 'native'
            });
        });
    
    
    
    $('.post__content img')
        .filter((index, element) => !$(element).closest('a').length && !$(element).closest('.post__main-img').length)
        .each((index, element) => {
            $(element).wrap('<a href="'+element.src+'" class="glightbox" data-gallery="post" data-type="image" />');
        });
    
    const postLightbox = GLightbox({
        loop: true
    });
    $('.section-tabs--scrollable').each((index, element) => {
        const sb = new ScrollBooster({
            viewport: element,
            direction: 'horizontal',
            scrollMode: 'transform',
            bounce: false
        });
    
        const activeItem = $('.section-tabs__active', element);
        if (activeItem.length && activeItem.index()) {
            const pos = activeItem.offset();
            const area = $(element).offset();
    
            let scrollTo = pos.left - area.left + (index ? 12 : 0);
    
            if (scrollTo > $(element).innerWidth()) {
                scrollTo = scrollTo - $(element).innerWidth() + activeItem.outerWidth();
            }
    
            sb.scrollTo({ x: scrollTo });
        }
    })
    window.scrollTo = function (selector) {
        if (!document.querySelector(selector)) {
            return;
        }
    
        document.querySelector(selector).scrollIntoView({ 
            behavior: 'smooth', 
            block: 'start'
        });
    }
    
    if ('' !== window.location.hash) {
        setTimeout(() => {
            window.scrollTo(window.location.hash);
        }, 1000);
    }
})();